import { Card } from "react-bootstrap";

const Song = (props) => {
  return (
    <Card>
      <img src={props.img} alt={props.title} style="width: 40px "></img>
      <h2>{props.title}</h2>
      <h3>by {props.artist}</h3>
      <p>
        {props.genre} | {props.year} | {props.length}
      </p>
    </Card>
  );
};

export default Song;
